import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

function createData(
  id: number,
  description: string,
  status: string,


) {
  return { id, description, status };
}

const rows = [
  createData( 1, 'Develop Giving Model and Identify Beneficiary', 'Complete' ),
  createData( 2, 'Create Initial Art Concept', 'Complete' ),
  createData( 3, 'Learn how to generate 5001 NFTs', 'Complete' ),
  createData( 4, 'Build Landing Page Website', 'Complete' ),
  createData( 5, 'Learn how to generate 5001 NFTs', 'Complete' ),
];

export default function BasicTable() {
  return (
    <TableContainer component={Paper} style={{ backgroundColor: "#212121", paddingLeft: "80px", paddingRight: "20px" }}>
      <Table sx={{ maxWidth: 400, minHeight: 400, }} style={{ backgroundColor: "#212121",}} aria-label="simple table">
        <TableHead >
          <TableRow >
            <TableCell style={{ color: "#ffffff"}} align="left">ID</TableCell>
            <TableCell style={{ color: "#ffffff"}} >Description</TableCell>
            <TableCell style={{ color: "#ffffff"}} >Status</TableCell>

          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow style={{ color: "#ffffff"}}
              key={row.id}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell style={{ color: "#ffffff",}} component="th" scope="row">
                {row.id}
              </TableCell>
              <TableCell style={{ color: "#ffffff", textDecoration: "line-through"}} >{row.description}</TableCell>
              <TableCell style={{ color: "#ffffff", }} >{row.status}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
